Visų trijų spalvų olimpinių medalių savininkas D.Kasparaitis rimtai iriasi dar vieno užsibrėžto tikslo link. Ne kartą viešai žadėjęs užsivilkti Lietuvos ledo ritulio marškinėlius, 14 sezonų geriausioje pasaulio ledo ritulio lygoje NHL praleidusį gynėją nuo tikslo skiria nepilnos trys savaitės. Lapkričio 10-12 dienomis Klaipėdoje, „Švyturio“ arenoje įvyksiančiame „CROWNS Baltic challenge cup“ ledo ritulio turnyre pirmą kartą ant pirmą kartą šioje arenoje liejamo pilnų matmenų ledo išbėgs D. Kasparaitis. „Ruošiuosi rimtai, metu svorį, salėje dirbu su svarmenimis. Treniruotėse specialiai bėgioju su jaunesniais, kad priprasčiau prie greičio. Kartu su manim žaidžia ir dainius Zubrus, tik jie niekaip negali mums įmušti ir nugalėti. Tad sportinė forma nebloga, dar turiu laiko“,– linksmai savo pasiruošimą apibūdino D. Kasparaitis. Dėl svajonės žaisti  Lietuvos rinktinėje  mažiau laiko penkiems vaikams skiriantis ledo ritulininkas jau sulaukė atžalų klausimo, kur dingsta tėtis ir ką jis čia sugalvojo. „Kai vaikams pasakiau, kad važiuosiu į Lietuvą žaisti ledo ritulį, jie niekaip nesupranta, kodėl reikia kažkur važiuoti. Juk ir šalia namų pilna aikštelių, galima žaisti niekur neišvykstant“, – vaikų rūpestį perdavė D. Kasparaitis. Pirmą kartą Lietuvoje rengiamame turnyre Klaipėdoje bus ir dar vienas įdomus momentas. Ant ledo turėtų susitikti ir Lietuvos garbę kartu ginti visi trys Kontinentinėje ledo ritulio lygoje (KHL) žaidę ir žaidžiantys lietuviai. Į Klaipėdą atvyks ir D. Kasparaičiu žais Rygos „Dinamo“ vartininkas  Mantas Armalis  ir gynėjas  Nerijus Ališauskas . Beje, į Klaipėdą turnyro metu turėtų atvykti ir dar viena Lietuvos ledo ritulio garsenybė, Dainius Zubrus. Neatmetama galimybė, kad kitų metų pasaulio ledo ritulio čempionato IB diviziono kovose Kauno „Žalgirio“ arenoje Lietuvos aistruoliai galės išvysti abu NHL lygoje žaidusius lietuvius, D. Kasparaitį ir D. Zubrų. (function(d, s, i, r) {
